                WriteLiteral(@"   <div class=""footer_container clear_float"">


            <div class=""app_guide"" style=""color:white"">
                    Hello dear supervisors and students,

                    Online courses follow a procedure that students must comply.

                    Each class starts with interactions with the teacher and it is 
                    mandatory. Students who do not interact are 
                    considered absent.

                    The teacher is the only one to ensure the smooth running of the course and 
                    the students must comply with his directives.

                    After the presentations, and depending on the course, 
                    the teacher can launch a discussion topic related to their course, 
                    or an exercise allowing them to assess the general level of the students. 
                    He / she will then summarize it and invite the students to read his / her 
                    course by downloading it in from DOC");
                WriteLiteral(@"UMENTS section on the website. 
                    After reading each student asks the necessary questions 
                    in the forum and the teacher provides the answers.

                    At the end of this, the teacher can give additional exercises 
                    (TD) to the students or decide to schedule an evaluation if the understanding 
                    of the course is considered good.

                    The assessment is done online and each student must make sure 
                    they have a reliable internet connection to do the assignment 
                    because we believe that the choice of online study is motivated 
                    by your ability to find a reliable internet connection to be able 
                    to follow without interruption. There are no hours or 
                    days common to all students for the assessment. On the other hand, 
                    once the assignment is agreed, each student must do it within a week. ");
                WriteLiteral(@"
                    In other words, he will be considered absent from duty and a zero mark 
                    is assigned to him straight away. He / she must validly justify 
                    himself / herself before being authorized to write another one. 
                    Copies of each assessment are placed in student lockers in the SHARE or 
                    PARTAGE block and each student will only see their own annotated copy. 
                    This step ends the course in question.

                    We would therefore like to urge you to strictly follow these requirements 
                    as any study must meet requirements to be valid.
